import React, { Component } from 'react';

const BarreDore = ({ color, width, height, position, opacity }) => (
  <div
    style={{
      backgroundColor: color,
      height: height,
      width: width,
      opacity: opacity,
      position: position
    }}
  ></div>
);

export class Home extends Component {
  render() {
    return (
      <div>
        <BarreDore
          color='#5A4D10'
          height='192px'
          width='32px'
          opacity='0.2'
          position='absolute'
        />
      </div>
    );
  }
}

export default Home;
